import Vue from 'vue';
import Router from 'vue-router';
import Createpartcomponent from './views/Createpartcomponent.vue';


Vue.use(Router);

export default new Router({
  routes: [

    {
      path: '/create',
      name: 'Createpartcomponent',
      component: Createpartcomponent,
    },
  ],
});
